INSERT INTO `advertiser_info` VALUES (1,'褒河蜜橘','<p>			<img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>		<span style=\"color: rgb(0, 0, 0);\">褒河蜜橘，陕西省汉中市汉台区特产，全国农产品地理标志。褒河蜜橘具有独特的生产地域、品质特性和特定的生产方式，果实扁圆形，果顶微凹，果皮光滑细腻，果色黄中泛红，色泽亮丽，果皮薄、易分离，香气浓郁，果肉橙红，汁多、无核、肉嫩、化渣，酸甜爽口，极具地方特色。2015年7月22日，原中华人民共和国农业部批准对“褒河蜜橘”实施国家农产品地理标志登记保护。</span></p>','2021-01-02 22:47:33'),(2,'皋兰软儿梨','<p>	<img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>		<span style=\"color: rgb(0, 0, 0);\">皋兰软儿梨，甘肃省兰州市皋兰县特产，全国农产品地理标志。皋兰软儿梨也叫冻梨、香水梨，果实近圆形，单个直径4～7厘米，单果重100～200克之间，秋末冬初成熟。初采摘时，果皮黄中带绿，青中泛红，外观鲜美，果肉较硬而味微酸；经40多天自然熟化，果皮变黄，果肉变软，果味变甜，称为“糖心梨”；随着气候变冷，果子冻结如石，果皮由黄变褐，果肉返砂，称为“软儿梨”。食用时置于温暖处自然解冻，梨软如泥，浆液充盈，味甜似蜜略有酒味。皋兰软儿梨每年深秋采摘后，经西北寒冽的冬天糖化、变黑后是皋兰软儿梨特有的吃法，成为当地群众严冬的一道特色美食。软儿梨新鲜的时候，果肉较硬而味酸，入口有噎嗓子的感觉，糖化后果肉发酵软化，果味变甜。2015年7月22日，原中华人民共和国农业部批准对“皋兰软儿梨”实施国家农产品地理标志登记保护。</span></p>','2021-01-02 22:47:39'),(3,'瓦仓大米','<p>	<img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>		<span style=\"color: rgb(0, 0, 0);\">瓦仓大米，湖北省远安县特产，全国农产品地理标志。瓦仓大米属中籼稻，谷粒金黄、大而饱满；米粒晶莹透亮、坚实丰满、腹白细少；米饭泡松柔软、入口绵甜、糯而不腻、清香四溢。2011年9月13日，原中华人民共和国农业部批准对“瓦仓大米”实施农产品地理标志登记保护。</span></p>','2021-01-02 22:47:48'),(4,'沾化海蜇','<p>	<img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>		<span style=\"color: rgb(0, 0, 0);\">海蜇又名水母，为海生腔肠动物，呈伞盖状，通体呈半透明，白色、青色或微黄色，伞下方口腕处有许多棒状和丝状触须，上有密集刺丝囊，能分泌毒液。其作用是在触及小动物时，可释放毒液麻痹，以做食饵。海蜇的营养丰富，每百克海蜇含蛋白质12.3克、碳水化合物4克、钙182毫克、碘132微克以及多种维生素。海蜇是天然保健食品，具有清热解毒、化痰、降血压、祛风、除湿、清积、润胆功能。加工后的产品，称伞部为海蜇皮，腕部为海蜇头。沾化县年均海蜇产量1.5万吨。王尔庄海蜇批发市场是全国规模最大的海蜇专业批发市场，年市场交易额可达20亿元。</span></p>','2021-01-02 22:47:53'),(5,'蕲春芹菜','<p>	<span style=\"color: rgb(0, 0, 0);\">蕲春芹菜，中国湖北省黄冈市蕲春县特产，全国农产品地理标志。蕲芹无主杆，根部硕大，是一团白茎，枝叶从白茎抽长，呈伞状蓬生，叶细碎而枝条纤细。蕲芹色泽翠绿，做菜脆嫩清香。2012年1月20日，原中华人民共和国农业农村部正式批准对“蕲春芹菜”实施农产品地理标志登记保护。</span></p><p>		<img src=\"data:image/jpeg;base64,\"></p>','2021-01-02 10:21:20');
